		@Parameter(description = "The number of results returned per page.") @RequestParam(required = false, defaultValue = DEFAULT_PAGE_SIZE) final int pageSize,
		@Parameter(description = "New Extended Catchwords") @RequestParam(name = NEW_CATCHWORDS_REQUEST_PARAM, required = false) final String newExtendedCatchword,
