		final HttpServletResponse response)
{
	final Optional<String> categoryCode = wagoCategoryFacade.getCategoryCodeForIdentifier(categoryIdentifier);

	if (categoryCode.isPresent())
	{
		final WagoSearchRequest request = wagoSearchRequestBuilderFactory.create()
				.setFacets(facets)
				.setSortCode(sortCode)
				.setCurrentPage(currentPage)
				.setPageSize(pageSize)
				.setNewExtendedCatchwords(newExtendedCatchword)
				.setAllExtendedCatchwords(allExtendedCatchwords)
				.build();

